import React, { useState, type MouseEventHandler, Fragment } from 'react'
import { useModalStore } from 'store/useModalStore'
import { useAuth } from 'contexts/AuthContext'
import { motion } from 'framer-motion'
import { AppBar, IconButton, Avatar, Popover, List, ListSubheader, ListItemButton, Typography, Box } from '@mui/material'
import OnlineIndicator from 'components/OnlineIndicator'

const Header: React.FC = () => {
  const { isLoggedIn, account, logout } = useAuth()
  const { setCurrentModal } = useModalStore()

  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null)

  const openPopover: MouseEventHandler<HTMLButtonElement> = (e) => setAnchorEl(e.currentTarget)
  const closePopover = () => setAnchorEl(null)

  const clickLogin = () => {
    setCurrentModal('LOGIN')
    closePopover()
  }

  const clickRegister = () => {
    setCurrentModal('REGISTER')
    closePopover()
  }

  return (
    <AppBar
      position="static"
      sx={{
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
        p: 2,
        bgcolor: 'primary.dark',
        boxShadow: 4,
      }}
    >
      {/* Title with a stylish font */}
      <Typography
        variant="h6"
        sx={{
          fontWeight: 'bold',
          fontSize: '1.5rem',
          textTransform: 'uppercase',
          letterSpacing: '1px',
        }}
      >
        Agent Management System
      </Typography>

      {/* Avatar Button with Hover Effects */}
      <motion.div whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.95 }}>
        <IconButton onClick={openPopover} sx={{ p: 1 }}>
          <OnlineIndicator online={isLoggedIn}>
            <Avatar
              src={account?.profilePic || ''}
              alt={account?.username || 'Guest'}
              sx={{
                width: 40,
                height: 40,
                border: '2px solid',
                borderColor: isLoggedIn ? 'success.main' : 'error.main',
                transition: '0.3s',
              }}
            />
          </OnlineIndicator>
        </IconButton>
      </motion.div>

      {/* Popover Menu with Animated Effects */}
      <Popover
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={closePopover}
        anchorOrigin={{ vertical: 'bottom', horizontal: 'right' }}
        transformOrigin={{ vertical: 'top', horizontal: 'right' }}
        PaperProps={{
          sx: {
            minWidth: '150px',
            borderRadius: 2,
            boxShadow: 3,
            p: 1,
          },
        }}
      >
        <Box
          component={motion.div}
          initial={{ opacity: 0, y: -10 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.2 }}
        >
          <List>
            <ListSubheader sx={{ textAlign: 'center', fontWeight: 'bold', color: 'primary.main' }}>
              Hello, {account?.username || 'Guest'}
            </ListSubheader>

            {isLoggedIn ? (
              <ListItemButton onClick={logout} sx={{ '&:hover': { bgcolor: 'error.light' } }}>
                Logout
              </ListItemButton>
            ) : (
              <Fragment>
                <ListItemButton onClick={clickLogin} sx={{ '&:hover': { bgcolor: 'success.light' } }}>
                  Login
                </ListItemButton>
                <ListItemButton onClick={clickRegister} sx={{ '&:hover': { bgcolor: 'info.light' } }}>
                  Register
                </ListItemButton>
              </Fragment>
            )}
          </List>
        </Box>
      </Popover>
    </AppBar>
  )
}

export default Header
